import React from 'react'

const PresentNews = (props) => {
    return(
        <React.Fragment>
            props.map((news,index)=>
            <h5 key={index}>{news.author}</h5>
            <br/>
            )
        </React.Fragment>
    )
}

export default PresentNews;
